import React, { useEffect, useState } from 'react';

const LevelPage = () => {
  const [headerExpand, setHeaderExpand] = useState(false);
  const [elementsVisible, setElementsVisible] = useState(false); // Состояние для видимости элементов
  const [level, setLevel] = useState(1);
  const [progress, setProgress] = useState(0); // Прогресс в процентах

  useEffect(() => {
    const headerTimeout = setTimeout(() => {
      setHeaderExpand(true);
      // После завершения анимации опускания, через 1 сек все элементы плавно появляются
      setTimeout(() => {
        setElementsVisible(true);
      }, 750); // Длительность совпадает с transition на высоту header
    }, 100);

    return () => clearTimeout(headerTimeout);
  }, []);

  // Обработчик нажатия на кнопку для увеличения прогресса
  const handleIncreaseProgress = () => {
    if (progress >= 100) {
      alert('Level Up!');
      setLevel(prev => prev + 1);
      setProgress(0);
    } else {
      setProgress(prev => prev + 20);
    }
  };

  // Функция для смены цвета прогресса в зависимости от уровня
  const getProgressColor = () => {
    const colors = ['#4caf50', '#2196f3', '#ff9800', '#9c27b0', '#e91e63']; // Зеленый, Синий, Оранжевый, Фиолетовый, Розовый
    return colors[(level - 1) % colors.length];
  };

  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'space-between',
      height: '100vh',
      textAlign: 'center',
      color: 'inherit',
      paddingBottom: '80px',
      fontFamily: "'Chakra Petch', sans-serif"
    }}>
      {/* Верхняя часть */}
      <div style={{
        width: '100%',
        height: headerExpand ? 'calc(65vh + 120px)' : '120px',
        boxShadow: '0 1px 50px rgba(93, 95, 98, 0.6)',
        backgroundColor: 'rgba(168, 8%, 91%, 0.76)',
        borderBottomLeftRadius: '50% 20%',
        borderBottomRightRadius: '50% 20%',
        position: 'absolute',
        top: 0,
        left: 0,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        overflow: 'hidden',
        transition: 'height 0.75s ease-in-out',
        flexDirection: 'column',
        opacity: elementsVisible ? 1 : 0, // Управление прозрачностью
        transition: 'opacity 0.75s ease-in-out'
      }}>
        <div style={{
          position: 'absolute',
          width: '200%',
          height: '200%',
          background: "url('https://www.transparenttextures.com/patterns/stardust.png') repeat",
          animation: 'level-moveBackground 20s linear infinite'
        }}></div>

        {/* Текущий уровень */}
        <h1 style={{
          fontFamily: "'Audiowide', sans-serif",
          color: '#fff',
          fontSize: '24px',
          zIndex: '2',
          opacity: elementsVisible ? 1 : 0, // Управление прозрачностью
          transition: 'opacity 0.75s ease-in-out'
        }}>{level} LEVEL</h1>

        {/* Полоска прогресса */}
        <div style={{
          position: 'relative',
          width: '56%',
          height: '15px',
          margin: '20px auto',
          backgroundColor: 'rgba(221, 221, 221, 0.1)',
          borderRadius: '10px',
          overflow: 'hidden',
          zIndex: '2',
          opacity: elementsVisible ? 1 : 0, // Управление прозрачностью
          transition: 'opacity 0.75s ease-in-out'
        }}>
          <div style={{
            height: '100%',
            width: `${progress}%`,
            backgroundColor: getProgressColor(),
            transition: 'width 0.5s ease',
          }}>
            {[...Array(5)].map((_, i) => (
              <div key={i} style={{
                position: 'absolute',
                height: '100%',
                width: '2px',
                backgroundColor: 'rgba(221, 221, 221, 0.)',
                left: `${(i + 1) * 20}%`,
                top: 0
              }} />
            ))}
          </div>
        </div>

        {/* Кнопка для увеличения прогресса */}
        <button onClick={handleIncreaseProgress} style={{
          marginTop: '10px',
          backgroundColor: getProgressColor(),
          color: '#fff',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          fontSize: '14px',
          zIndex: '2',
          padding: '10px 20px',
          opacity: elementsVisible ? 1 : 0, // Управление прозрачностью
          transition: 'opacity 0.75s ease-in-out'
        }}>
          Increase Progress
        </button>

        {/* Блоки с текстами */}
        {['Left Text 1', 'Left Text 2', 'Left Text 3'].map((leftText, i) => (
          <div key={i} style={{
            marginTop: "20px",
            backgroundColor: 'gray',
            borderRadius: '20px',
            height: '50px',
            width: '80%',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center', // Выравнивание по вертикали по центру
            padding: '0 20px', // Уменьшили padding, чтобы сохранить высоту
            opacity: elementsVisible ? 1 : 0, // Управление прозрачностью
            transition: `opacity 0.75s ease-in-out ${0.1 * i}s` // Задержка появления для каждого блока
          }}>
            <span>{leftText}</span>
            <span>{`Right Text ${i + 1}`}</span>
          </div>
        ))}
      </div>

      {/* Добавление анимации через тег style */}
      <style>{`
        @keyframes level-moveBackground {
          0% { background-position: 0 0; }
          100% { background-position: -1000px -1000px; }
        }
      `}</style>
    </div>
  );
};

export default LevelPage;
